import React, { Component } from 'react';



class SubHeader extends Component {

	render(){
		return(
			<nav class="navbar navbar-dark bg-dark">
				<span class="navbar-text">
					SHOPMATE
				</span>
				<span class="navbar-text">
					Women
				</span>
				<span class="navbar-text">
					Men
				</span>
				<span class="navbar-text">
					Kids
				</span>
				<span class="navbar-text">
					Shoes
				</span>
				<span class="navbar-text">
					Brands
				</span>
			</nav>
		);
	}
}





export default SubHeader;
